import React from "react";

const Portfolio = () => {
  return (
    <div>
      <div class="uk-flex uk-flex-center">
        <div class="uk-card uk-card-default uk-card-body">Item 1</div>
        <div class="uk-card uk-card-default uk-card-body uk-margin-left">
          Item 2
        </div>
        <div class="uk-card uk-card-default uk-card-body uk-margin-left">
          Item 3
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
